description:
●राजस्थान में धार्मिक आंदोलन का श्रीगणेश करने का श्रेय धन्नाजी को ही है। धन्नाजी का जन्म टोंक के धुवन गाँव में 1415 ई. में जाट परिवार में हुआ था।<br />
●कालांतर में धन्नाजी काशी जाकर आचार्य रामानन्द के शिष्य बन गए। गुरु रामानंद के प्रभाव से ये निर्गुण उपासक हो गए।<br />
●इन्होंने नाम-स्मरण को ही ईश्वर प्राप्ति का प्रमुख साधन माना है तथा औपचारिकताओं और बाह्याडम्बरों का विरोध किया।&nbsp;
